import React, { useState } from 'react';
import './App.css';

function App(props) {

  return (
      <div className="todoapp stack-large">
          <h1>To-do CRUD</h1>
          <form>
            <h2 className="label-wrapper">
              <label htmlFor="new-todo-input" className="label_lg">
                What needs to be done?
              </label>
            </h2>
            <input
              type="text"
              id="new-todo-input"
              className="input input__lg">
            </input>
          </form>
      </div>
  );
}

export default App;
